// ----------------------------------------------------------
// Example of Aborting a Fetch Request
// ----------------------------------------------------------
//
// | / | clear | about | json | array | versions |

doGet("/test/versions", 5000);

function doGet(route, msTimeout) {
	// Create a new AbortController instance.
	const controller = new AbortController();
	const signal = controller.signal;
	const urlRoot = "http://localhost:3000";

	// Make the fetch request with the signal.
	const fetchPromise = fetch(urlRoot + route, {
		signal
	});

	// Timeout after specified number of milliseconds.
	const timeoutId = setTimeout(()=>{
		controller.abort();
		// Abort the fetch request.
		console.log("Fetch request timed out.");
	}
	, msTimeout || 5000);

	// Handle the fetch request
	fetchPromise.then(response=>{
		// Check if the request was successful.
		if (!response.ok) {
			throw new Error(response.statusText);
		}
		// Parse the response as JSON
		return response.json();
	}
	).then(data=>{
		// Handle the JSON data.
		console.log(data);
	}
	).catch(error=>{
		// Handle any errors that occurred during the fetch.
		console.error(error);
	}
	).finally(()=>{
		// Clear the timeout.
		clearTimeout(timeoutId);
	}
	);
}

