// ----------------------------------------------------------
// Example of Using Fetch to Upload JSON Data:
// ----------------------------------------------------------

const urlRoot = "http://localhost:3000";
const base64string = "data:image/gif;base64,";

if (1) {
	doPut(urlRoot + "/test/resize-gif", {
		"base64String": base64string,
		"width": 150
	});
} else {
	doPut(urlRoot + "/test/upload-gif", {
		"base64String": base64string,
		"filename": "testserver.gif"
	});
}

function doPut(url, jsonData) {
	// Set up options for the fetch request.
	const options = {
		method: "PUT",
		headers: {
			// Set content type to JSON.
			"Content-Type": "application/json"
		},
		// Convert JSON data to a string and set it as the request body.
		body: JSON.stringify(jsonData)
	};
	//
	// Make the fetch request using the provided options.
	fetch(url, options).then(response=>{
		// Check if the request was successful.
		if (!response.ok) {
			throw new Error("Network response was not ok");
		}
		// Parse the response as JSON.
		return response.json();
	}
	).then(data=>{
		// Handle the JSON data.
		console.log(data);
	}
	).catch(error=>{
		// Handle any errors that occurred during the fetch.
		console.error("Fetch error:", error);
	}
	);
}
