// ---------------------------------------------------------------------------
// Returns the text associated with the specified node.
// ---------------------------------------------------------------------------
function getText(pNode) {
	if (!pNode)
		return;
	if (pNode.nodeType == 3)
		return pNode.nodeValue;
	var pNodes = pNode.childNodes
	// get the child nodes of the passed element
	let nLen = pNodes.length
	// count how many there are
	var text = "";
	for (var idx = 0; idx < nLen; idx++) {
		// loop through the child nodes
		if (pNodes[idx].nodeType == 3) {
			// if the child node is a text node
			text += pNodes[idx].nodeValue;
			// concatenate the value to the text string
		} else {
			// Pass it to this function again and concatenate its value
			text += getText(pNodes[idx]);
			// to the entire text
		}
	}
	return text;
}

