// http://192.168.10.50:81/

(function() {
    var urls = [
    "services/network/configtool?lang=en",
    "services/network/login?lang=en",
    "services/network/networksettings?lang=en",
    "services/network/systemsettings?lang=en",
    "services/network/securitysettings?lang=en",
    "services/network/xpresssettings?lang=en",
    "services/network/aboutinfo?lang=en",
    "services/network/refreshunits?lang=en",
    "services/network/isExisting/172.25.8.39",
    "services/network/isExisting/192.168.10.100",
    "services/network/userssessions",
    "services/network/memoryinfo",
    "services/network/systemdata",
    "services/network/xpressdata",
    "services/network/aboutdata",
    "services/network/timezonelist",
    "services/network/adapterinfo",
    "services/network/datetimesettings",
    "services/network/internettimeservers",
    "services/network/languagedata?lang=en", // Uses XML on PAC, JSON on PC
    "services/network/languagedata?lang=fr", // Uses XML on PAC, JSON on PC
    "services/network/networkdata/2",
    "services/network/networkdata/3",
    "services/network/iscurrentipaddress/1/192.168.10.50",
    "services/network/demo/aboutinfo",
    "services/network/demo/supportedlanguages",
    "services/network/demo/xpresssettings",
    "demo/data/userssessions.json"
     ];

    // Array index is 0-based!
    var beg = 0;
    var end = 30;

    end = (end >= urls.length) ? (urls.length - 1) : end;
    beg = Math.min(beg, end);

    console.log("# URLs to execute: %s (of %s)", (end - beg + 1), (urls.length));

    let promiseChain = [];

    for (var i = beg; i < end + 1; i++) {
        promiseChain.push(get(urls[i]));
    }

    Promise.all(promiseChain).then(callback);

    function callback(data) {
        for (var n = 0; n < data.length; n++) {
             console.group(data[n].responseURL);
             console.log(data[n].status === 200 ? 
             data[n].responseXML === null ? JSON.parse(data[n].responseText) : data[n].responseXML : undefined);
             console.groupEnd();
        }
    }

    function get(url) {
        // Return a new promise.
        return new Promise(function(resolve, reject) {
            // Do the usual XHR stuff
            var req = new XMLHttpRequest();
            req.open('GET', url);
            req.onload = function() {
                // This is called even on 404 etc., so check the status
                if (req.status == 200) {
                    // Resolve the promise with the response text
                    resolve(req);
                } else {
                    // Otherwise reject with the status text which will hopefully be a meaningful error
                   //reject(Error(req.statusText));
                   resolve(req);
                }
            };
            // Handle network errors
            req.onerror = function() {
                reject(Error("Network Error"));
            };
            // Make the request
            req.send();
        }
        );
    }
}
)();
