(function() {
    var href = null;
    const anchorElements = document.querySelectorAll("a");
    for (const anchor of anchorElements) {
        href = getHref(anchor);
        if (href) {
            break;
        }
    }
    console.log(`Unsubscribe href: ${(href) ? href : "<not available>"}`);
}
)();

function getHref(anchor) {
    const linkText1 = "unsubscribe";
    const linkText2 = "manage your subscription";
    const linkText3 = "email preferences";

    let txt = anchor.textContent;
    if ((txt))
        txt = txt.trim().toLowerCase();
    if (!(txt)) {
        txt = anchor.getAttribute("alias")
        if ((txt))
            txt = txt.trim().toLowerCase();
    }
    if (isMatch(txt)) {
        return anchor.getAttribute("href");
    }
    if ((txt) && (txt.includes("click here") || txt.includes("here"))) {
        if (anchor.parentNode) {
            txt = anchor.parentNode.innerHTML;
            if (isMatch(txt))
                return anchor.getAttribute("href");
        }
    }
    if (anchor.previousSibling) {
        txt = anchor.previousSibling.textContent;
        if (isMatch(txt))
            return anchor.getAttribute("href");
    }
    return null;
    function isMatch(txt2) {
        if (!txt2)
            return false;
        txt2 = txt2.trim().toLowerCase();
        return txt2.includes(linkText1) || txt2.includes(linkText2) || txt2.includes(linkText3)
    }
}
