// Returns a promise that resolves with a File instance.
// Works for any type of url, (http url, dataURL, blobURL, etc...)
// The fileName (and its extension) are both optional.
function urltoFile(url, fileName) {
	fileName = fileName || "newfile";
	var fName;
	var mimeType = url.match(/^data:(.+);base64/)?.[1]
	let extension = getFileExtensionFromFileName(fileName);
	if (extension) {
		fName = fileName;
	} else {
		extension = getFileExtensionFromMimeType(mimeType) || "txt";
		fName = `${fileName}.${extension}`;
	}
	if (url.startsWith('data:')) {
		var arr = url.split(',')
		  , mime = arr[0].match(/:(.*?);/)[1]
		  , bstr = atob(arr[arr.length - 1])
		  , n = bstr.length
		  , u8arr = new Uint8Array(n);
		while (n--) {
			u8arr[n] = bstr.charCodeAt(n);
		}
		var file = new File([u8arr],fName,{
			type: mime || mimeType
		});
		return Promise.resolve(file);
	}
	return fetch(url).then(res=>res.arrayBuffer()).then(buf=>new File([buf],fName,{
		type: mimeType
	}));
}

function getFileExtensionFromFileName(fileName) {
	let idx = fileName.lastIndexOf(".");
	return idx > -1 ? fileName.slice(idx + 1) : "";
