//var base64String = "data:text/javascript;base64,";
//var fileName = "example.tmp";

var base64String = "data:image/jpeg;base64,";

// Save Base64String as a file.
saveBase64StringAsFile(base64String, fileName);

// Save Base64String as a file.
function saveBase64StringAsFile(base64String, fileName) {
	// Convert Base64 to Blob.
	const blob = base64StringToBlob(base64String);
    const link = document.createElement('a');
    link.href = URL.createObjectURL(blob);
    link.download = fileName;
    link.click();
}

// Convert Base64String to a Blob.
function base64StringToBlob(base64string) {
	let mimeType = base64string.match(/^data:(.+);base64,/)?.[1];
	base64string = base64string.replace(/^data:(.+);base64,/, "");
    const byteCharacters = atob(base64string);
    const byteArray = [];
    for (let i = 0; i < byteCharacters.length; i++) {
        byteArray.push(byteCharacters.charCodeAt(i));
    }
    const newUint8Array = new Uint8Array(byteArray);
    return new Blob([newUint8Array], { type: mimeType });
}
